return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2021-09-14 05:07:02+0000','plural-forms'=>'nplurals=2; plural=n > 1;','project-id-version'=>'Themes - Education Zone','language'=>'id','messages'=>['Education Zone is a free clean, beautiful and professional looking WordPress Theme specially designed for Education Institutions. This theme is best suited for college, school, university, LMS, Training Center, Academy, Primary School, High school and Kindergarten and other educational websites. The theme is very flexible and versatile can be used to build various types of business and corporate websites. The theme is highly customizable with various features and personalization options. Education Zone comes with several features to make a user-friendly, interactive and visually stunning website. Such features include custom menu, attractive banner, Stat counter, Courses section, testimonial section, Banner with Call to Action Button (CTA), and social media. The theme is SEO friendly with optimized codes, which make it easy for your site to rank on Google and other search engines. The theme is rigorously tested and optimized for speed and faster page load time and has a secure and clean code. The theme is also translation ready. Designed with visitor engagement in mind, Education Zone helps you to easily and intuitively create professional and appealing websites. If your school, college or university needs an online home that is dynamic and multi-functional, this theme is a good place to start. Check the demo at https://rarathemes.com/previews/?theme=education-zone, documentation at https://docs.rarathemes.com/docs/education-zone/, and get support at https://rarathemes.com/support-ticket/.'=>'Education Zone adalah tema WordPress yang rapi, bagus dan tampak profesional; didesain khusus untuk Institusi Pendidikan. Tema ini sangat cocok untuk kampus, sekolah, universitas, LMS, Pusat Pelatihan, Akademi, Sekolah Dasar, Sekolah Menengah Atas dan Kindergarten dan situs web pendidikan lainnya. Tema ini sangat fleksibel dan serbaguna dapat digunakan untuk membangun berbagai jenis situs web bisnis dan perusahaan. Tema sangat mudah disesuaikan dengan aneka fitur dan opsi personalilasi. Education Zone hadir dengan berbagai macam fitur meliputi menu khusus, banner yang atraktif, penghitung statistik, bagian Course, bagian testimonial, Banner dengan Call to Action Button (CTA), dan media sosial. Tema ini ramah SEO dengan kode yang dioptimalkan, yang menjadikan situs Anda mudah diranking di Google dan mesin pencari lainnya. Tema ini diuji secara ketat dan dioptimalkan untuk kecepatan dan waktu pemuatan halaman yang lebih cepat dan memiliki kode yang aman dan bersih. Tema ini juga siap diterjemahkan. Didesain dengan mempertimbangkan keterlibatan pengunjung, Education Zone membantu Anda secara mudah dan intuitif membuat situs web yang profesional dan menarik. Jika sekolah, kampus atau universitas Anda membutuhkan rumah online yang dinamis dan multi-fungsi, tema ini sangat cocok Anda gunakan untuk memulai. Cek demo di https://rarathemes.com/previews/?theme=education-zone, dokumentasi di https://docs.rarathemes.com/docs/education-zone/, dan layanan bantuan di https://rarathemes.com/support-ticket/.','Education Zone'=>'Education Zone',')'=>')',' (Page'=>'(Halaman','Rara One Click Demo Import'=>'Rara One Click Demo Import','Name'=>'Nama','Contact Form 7'=>'Contact Form 7','Lato font: on or offon'=>'aktifkan','Roboto font: on or offon'=>'aktif','Dismiss'=>'Singkirkan','Congratulations!'=>'Selamat!','Skip to content (Press Enter)'=>'Lompat ke konten (Tekan Enter)','%1$s is now installed and ready to use. Click below to see theme documentation, plugins to install and other details to get started.'=>'%1$s saat ini sudah diinstall dan siap digunakan. Klik di bawah untuk melihat dokumentasi tema, plugin untuk diinstal dan detail lainnya untuk memulai.','Education Zone | Developed By'=>'Education Zone | Diciptakan Oleh','The following r